import styles from "../component/card.css"

function Card(props) {
    let className;
    {(props.boolean=='true')
    ? className = 'regular'
    : className = ''
    }
       return (
    <div>

      <section >
       <div>
       <article className={className}>
           <p>{props.english}> {props.transciption}</p>
           <p>{props.russian} </p>
           <p>{props.tags}</p>
       </article>
       </div>
       </section>
        </div>
    );
}
export default Card
